import React, { FC } from "react";
import "./Search.css";
import MyInput from "../MyInput/MyInput";
interface SearchInt {
  onChange: (e: {
    target: {
      value: React.SetStateAction<string>;
    };
  }) => void;
  isRTL: boolean;
  value: string;
}
const Search: FC<SearchInt> = ({ onChange, isRTL, value }) => {
  return (
    <div className="searchBox">
      <MyInput
        name={isRTL ? "חיפוש..." : "Search..."}
        onChange={onChange}
        value={value}
        isRequired
      />
      <input type="" />
    </div>
  );
};

export default Search;
